import React, { SyntheticEvent, useState } from 'react'
import { styled } from '@mui/material/styles'
import { Tabs, Tab, Box, Paper, Typography, Grid } from '@mui/material'
import EditProfile from './EditProfile'
import ProfilePhoto from './ProfilePhoto'
import Header from '../main/header'
import PrivacyAndSecirity from './PrivacyAndSecurity'
import TermsAndCondition from './TermsAndConditions'
import Loading from '../shared/Loading'
import { useQuery, gql } from '@apollo/client'


const CURRENT_USER = gql`
query CurrentUser {
  currentUser{
    email
    firstName
    lastName
    phone
    imageUrl
    passwordDigest
  }
}
`

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}))

interface TabPanelProps {
  children?: React.ReactNode
  index: number
  value: number
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props

  return (
    <div
      role='tabpanel'
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  )
}

export default function ProfileWrapper(): JSX.Element {
  const [value, setValue] = useState(0)
  const { data, loading } = useQuery(CURRENT_USER)
  const handleChange = (event: SyntheticEvent, newValue: number) => setValue(newValue)

  if (loading) return <Loading />
  return (
    <Box sx={{ marginTop: '100px' }}>
      <Grid container spacing={2}>
        <Header />
        <Grid
          item xs={12}
          sm={3}
          md={5}
          sx={{
            height: '100vh',
            backgroundColor: '#000'
          }}>
          <ProfilePhoto
            imageUrl='../images/avatar.jpg'
            fullName='Kofi Boakye'
          />
        </Grid>
        <Grid item xs={12} sm={8} md={7}>
          <Box sx={{ width: '100%' }}>
            <Box>
              <Tabs value={value} onChange={handleChange}>
                <Tab label='Profile' />
                <Tab label='Privacy & Security' />
                <Tab label='Terms & Condition' />
              </Tabs>
            </Box>
            <TabPanel value={value} index={0}>
              <EditProfile user={user} showAuth={false} />
            </TabPanel>
            <TabPanel value={value} index={1}>
              <PrivacyAndSecirity />
            </TabPanel>
            <TabPanel value={value} index={2}>
              <TermsAndCondition />
            </TabPanel>
          </Box>
        </Grid>
      </Grid>
    </Box >
  )
}
